import React, { useState } from 'react';
import StartButton from './components/StartButton';
import SelectionButton from './components/SelectionButton';
import Spinner from './components/Spinner';
import './styles/App.css';
//import Calendly from './components/Calendar';
// import Navbar from './components/Navbar';
import { useAuth0 } from "@auth0/auth0-react";
import { Layout } from 'antd';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
/*import Header from './components/Header';*/
import FileUploadPage from './components/uploadFile';
import LogoutButton from './components/LogoutButton';



const { Header, Content, Footer } = Layout;



function App() {

  const { isLoading, isAuthenticated } = useAuth0();
  const menuKeys = ['1', '2', '3'];


  if (isLoading) { return (<div className='container'><Spinner/></div>) };
  if (!isAuthenticated) { return (<div className='container'><StartButton/></div>) };


  return (
    <Router>
    <Layout>
        <Sider style={{background:'black'}} breakpoint="lg"
      collapsedWidth="0"
      onBreakpoint={broken => {
        console.log(broken);
      }}
      onCollapse={(collapsed, type) => {
        console.log(collapsed, type);
      }}>
        <div className="logo">
          <a  href="https://techstars.com">
          <img src={logoUrl} alt="techstarts icon" />
          </a>
        </div>
        <Menu style={{background:'black', border:'none'}} mode="inline" defaultSelectedKeys={['4']}>
          <Menu.Item key="1" icon={<HomeOutlined style={{color:'#39C463'}}/>}>
            <Link style={{ color:'white'}} to="/">Home</Link>
          </Menu.Item>
          <Menu.Item key="2" icon={<BarChartOutlined style={{color:'#39C463'}} />}>
            Dashboard
          </Menu.Item>
          <Menu.Item key="3" icon={<TableOutlined style={{color:'#39C463'}}/>}>
            Results
          </Menu.Item>
          <Menu.Item key="4" icon={<LogoutOutlined style={{color:'#39C463'}}/>}>
            <LogoutButton/>
          </Menu.Item>
        </Menu>
      </Sider>
         <Layout>
            <Header style={{background:'black'}}>
            </Header>
            <Content className="container">
              <Switch>
                <Route path="/Schedule">
                  <FileUploadPage/>
                </Route>
                <Route path="/Dashboard">
                  Dashboard
                </Route>
                <Route path="/">
                  <SelectionButton name='Matching' path="/Dashboard"/>
                  <SelectionButton name='Scheduling' path="/Schedule"/>
                </Route>
              </Switch>
            </Content>
            <Footer style={{background:'#111111'}}></Footer>
          </Layout>
     </Layout>
     </Router>
  );
}

export default App;
